Appointment of Simon Wade as Ambassador of Canada to the Republic of
Suriname; James Fox as Ambassador of Canada to the Republic of
El Salvador; Art Wright as High Commissioner for Canada to the Republic
of Botswana with concurrent accreditation as Ambassador of Canada to the
People's Republic of Angola as well as to the Republic of Mozambique;
Réjean Frenette as Ambassador of Canada to the Republic of Bénin;
Marc Brault as High Commissioner for Canada to the Kingdom of Lesotho as
well as High Commissioner for Canada to the Kingdom of Swaziland;
Peter Sutherland as Ambassador of Canada to the Republic of Yemen;
Russel Davidson as Ambassador of Canada to the Dominican Republic;
Arsène A. Després as Ambassador of Canada to the Central African
Republic; Lucie Geneviève Edwards as High Commissioner for Canada to the
Republic of Uganda with concurrent accreditation as Ambassador of Canada
to the Republic of Rwanda as well as to the Republic of Burundi;
J. Christopher Poole as Ambassador of Canada to the Sultanate of Oman
concurrently accredited as Ambassador of Canada to the State of Qatar;
Jeremy K.B. Kinsman as Ambassador of Canada to the Republic of Armenia
with concurrent accreditation as Ambassador of Canada to the Republic of
Tadjikistan, the Republic of Kazakhstan, the Republic of Uzbekistan, the
Republic of Belarus, the Republic of Kyrgyzstan as well as Turkmenistan;
and Peter Hancock as Ambassador of Canada to the Republic of Georgia
concurrently accredited as Ambassador of Canada to the Republic of
Azerbaijan.
